INSERT INTO `category_details` VALUES (1,'Poke Bowls','85107042025160756.jpg','Bauen Sie Ihren eigenen Bowl','Gestalten Sie Ihren eigenen Bowl ganz nach Ihrem Geschmack! Wählen Sie Basis, Proteine, Toppings und Saucen. Frisch, individuell und lecker.');
