INSERT INTO `content` VALUES (1,'about','Willkommen bei Pok&eacute; Pao &ndash; Ihre Reise ins kulinarische Paradies!','  &lt;p&gt;Pok&eacute; Pao ist nicht nur ein Restaurant, sondern ein Erlebnis. Ausgezeichnet von der Europ&auml;ischen Pok&eacute; Bowl Akademie als Bestes Pok&eacute;-Lokal Deutschlands 2024, bringen wir die Aromen Hawaiis direkt auf Ihren Tisch. Unsere Mission ist es, Frische, Geschmack und gesunde Ern&auml;hrung in perfekter Harmonie zu vereinen.&lt;/p&gt;&lt;p&gt;Erleben Sie die Kunst, Ihren eigenen Pok&eacute; Bowl zu kreieren &ndash; mit sorgf&auml;ltig ausgew&auml;hlten Zutaten wie frischem Fisch, knackigem Gem&uuml;se und einzigartigen Toppings wie mariniertem Ingwer. Unsere Salate und Bowls bieten Ihnen endlose M&ouml;glichkeiten, sich kreativ auszuleben und gleichzeitig gesund zu genie&szlig;en.&lt;/p&gt;&lt;p&gt;Ob vor Ort, zum Mitnehmen oder per Lieferung &uuml;ber Lieferando, Wolt und Uber Eats &ndash; Pok&eacute; Pao ist Ihr Partner f&uuml;r frische, n&auml;hrstoffreiche und unvergleichlich k&ouml;stliche Mahlzeiten. Entdecken Sie den Geschmack Hawaiis und lassen Sie sich von der Qualit&auml;t und Leichtigkeit unserer Gerichte begeistern!&lt;/p&gt;',2,'about');
